INSERT INTO `clients` (`client_id`, `client_category_id`, `client_name`, `client_precedence`, `client_description`, `client_logo`, `created_at`, `updated_at`) VALUES
(13, 10, 'Islami Bank Bangladesh Ltd', 1, '<p>Islami Bank Bangladesh Ltd. is an Islamic banking company based in Bangladesh. It became incorporated on 13 March 1983 as a public limited company under the Companies Act 1913.</p>', 'images/clients/279logo-3.png', '2021-08-07 13:41:55', '2021-08-07 13:41:55'),
(14, 10, 'Summit Meghnaghat power company Ltd', 30, '<p>Incorporated in Singapore, Summit Power International Limited (Summit Power International) is a leading infrastructure developer and operator in South Asia.</p>', 'images/clients/927logo (2).png', '2021-08-07 13:54:09', '2021-08-07 15:17:02'),
(15, 10, 'Bangladesh Election Commission', 3, '<p>The Bangladesh Election Commission, abbreviated and publicly referred to as EC, is an independent constitutional body that operates the legal functions of election laws in Bangladesh.</p>', 'images/clients/402output-onlinepngtools (2).png', '2021-08-07 14:38:12', '2021-08-07 14:42:03'),
(16, 10, 'Bangladesh Krishi Bank Ltd', 4, '<p>Bangladesh Krishi Bank is a fully government owned bank in Bangladesh founded in 1973. The primary purpose of the bank is to provide services to farmers and agricultural industry.</p>', 'images/clients/937output-onlinepngtools (3).png', '2021-08-07 14:43:24', '2021-08-07 14:44:41'),
(17, 10, 'Social Islami Bank Ltd.', 5, '<p>Founded in 1995, Social Islami Bank ltd is the country&rsquo;s leading value-added financial institution based on Shariah\' Principles. SIBL comprises of &nbsp;SIBL Securities Ltd, SIBL Investment Ltd, SIBL Foundation Hospital. Working closely with our valued clients and stakeholders to provide them one-stop services, access to the very latest products using technology. Our unrivaled customer services has made us unparalleled in the industry. We build a long term business partnerships with our client helping them grow profitable.</p>\r\n<p>We are always ready to serve you with 4000 employees in 168 &nbsp;branches and 79 &nbsp;subbranches across the country. It has also 177 &nbsp;Agent Banking outlets to cater financial services to the remotest parts of the Land.&nbsp;</p>\r\n<p>The strong conviction to create a caring society is the cornerstone of SIBL&rsquo;s all activities. We feel a strong affinity to the emotions of people. We believe that only banking activities can&rsquo;t usher our society to a just and equitable stage. Thus we are extensively engaged in CSR activities on humanitarian grounds. We work in the fields such as from poverty eradication to family empowerment. Unlike others, the Bank&rsquo;s criteria for success are not only the key objective to make profit but also landmarks to become the country&rsquo;s most humanitarian and complete Bank.</p>', 'images/clients/533output-onlinepngtools (4).png', '2021-08-07 14:46:34', '2021-08-07 14:46:34'),
(18, 10, 'Al-Arafah Islami Bank Ltd.', 6, '<p>With the objective of achieving success here &amp; hereafter by pursuing the way directed by Allah and the path shown by His Rasul (SM), Al Arafah Islami Bank Ltd was established (registered) as a private limited company on 18 June 1995. The inaugural ceremony took place on 27 September 1995. The authorized capital of the Bank is Tk.15000.00 million and the paid up capital is Tk. 10440.22 million as on 31.12.2018. Renowned Islamic Scholars and pious businessmen of the country are the sponsors of the Bank. 100% of paid up capital is being owned by indigenous shareholders.The equity of the bank stood at Tk. 2348.32 crore as on 31 December 2018, the manpower was 3682 as on 31 December 2018 and the number of shareholders was 25793 as on 31 December 2018 . It has achieved a continuous profit and declared a good dividend over the years. High quality customer service through the integration of modern technology and new products is the tool of the bank to achieve success. The bank has a diverse array of carefully tailored products and services to satisfy customer needs.The Bank is committed to contribute significantly to the national economy. It has made a positive contribution towards the socio economic development of the country with 184 branches of which 25 is AD throughout the country.</p>', 'images/clients/595output-onlinepngtools (5).png', '2021-08-07 14:48:34', '2021-08-07 14:48:34'),
(19, 10, 'Bangladesh Development Bank Ltd.', 7, '<p>With the decision of the Government, Bangladesh Development Bank Ltd. (BDBL) was incorporated on 16 November, 2009 as a Public Company Limited &nbsp;by shares under the Companies Act, 1994 by amalgamation of &nbsp;former Bangladesh Shilpa Bank (BSB) and Bangladesh Shilpa Rin Sangstha (BSRS), two Development Financial Institutions (DFIs) in the public sector.</p>\r\n<p>Bangladesh Shilpa Bank (BSB) was established on October 31, 1972 for accelerating the industrial pace of the country through providing loan and equity to the industrial projects as per Bangladesh Shilpa Bank Order, 1972 (President&rsquo;s Order No. 129 of 1972).</p>\r\n<p>With the same objective, Bangladesh Shilpa Rin Sangstha (BSRS) was also established on October 31, 1972 as per Bangladesh Shilpa Rin Sangstha Order, 1972 (President&rsquo;s Order No. 128 of 1972).</p>\r\n<p>In order to carry on business of BDBL, Bangladesh Bank issued banking licence on<br />19-11-2009.</p>\r\n<p>Two Vendors&rsquo; Agreements were signed between the Government of the People&rsquo;s Republic of Bangladesh and the BDBL on 31 December, 2009 to acquire and take-over all of their (BSB &amp; BSRS) assets, benefits, &nbsp;rights, powers, authorities, privileges, liabilities, borrowings and obligations and to carry on with the same business.</p>\r\n<p>As a Public Limited Company, BDBL formally embarked its journey on January 03, 2010. It extends financial assistance for setting up industries and provides all kinds of commercial banking services to its customers through its branch network in Bangladesh.</p>\r\n<p>The BDBL also inherited membership of Dhaka Stock Exchange Limited (DSE) and Chittagong Stock Exchange Limited (CSE). In order to contribute to the capital market, it acts as stock dealer and stock broker and operates a brokerage houses, at Motijheel to provide services to the small and medium investors. BDBL also established a fully owned subsidiary company namely BDBL Securities Limited and transferred its one membership with DSE and another membership with CSE. It acts stock dealer and stock broker and operate brokerage House At 12, Karwan Bazar Dhaka to provide Investors. The BDBL is also managing a close-end Mutual Fund with paid up capital of Tk. 5.00 crore</p>', 'images/clients/101output-onlinepngtools (6).png', '2021-08-07 14:51:10', '2021-08-07 14:51:10'),
(20, 10, 'United Commercial Bank', 9, '<p>With a firm commitment of the economic and social development of Bangladesh, United Commercial Bank (UCB) started its journey in mid 1983 and has since been able to establish itself as one of the largest first generation banks in the country. With a vast network of 204 branches the Bank has already made a distinct mark in the realm of Private Sector Banking through personalized service, innovative practices, dynamic approach and efficient Management.</p>\r\n<p>The Bank has expanded its arena in different and diverse segments of banking like Retail Banking, SME Banking, Corporate Banking, Off-shore Banking, and Remittance etc. Besides various deposit and loan products of Retail Banking, the Bank caters export and import loan to deserving candidates which in turn helps the overall economy of the country through increased earning of foreign exchange. Other consumer products like UCB Cards have been showing tremendous success and growth since its inception in 2006 and soon became the leader in local market with around 40000 card holders.</p>\r\n<p>The Bank also provides its clients with both incoming and outgoing remittance services. Thus the expatriates find an easy way to send money through proper channel.</p>\r\n<p>With a firm commitment to promote SME sector, the Bank is also assessing and monitoring business loans, managing business financing risks, pricing products and working for further development of SME. Its Corporate banking service consists of simple business of issuing loans to more complex matters, such as helping minimize taxes paid by overseas subsidiaries, managing changes in foreign exchange rates or working out the details of financing packages necessary for the construction of a new office, plant or other facility. Its area of expertise is in-depth knowledge in financial analysis with analytical capability of financing large project including RMG and infrastructure development projects.</p>\r\n<p>The Bank, aiming to play a leading role in the economic activities of the country, is firmly engaged in the development of trade, commerce and industry by investing in network expansion and new technology adoption to have competitive advantage.</p>', 'images/clients/492logo-2.png', '2021-08-07 14:52:12', '2021-08-07 14:52:12'),
(21, 10, 'South Bangla Agricultural Bank Ltd', 9, '<p>South Bangla Agriculture and Commerce Bank Limited (SBAC) is a private commercial bank headquartered in Dhaka, Bangladesh. It incorporated in 2013 as a banking company under Companies Act. 1994 &amp; regulated under Banking Companies Act. 1991. The bank has network of 82 branches and 6 Sub-branches around the country.</p>', 'images/clients/991output-onlinepngtools (7).png', '2021-08-07 14:53:50', '2021-08-07 14:53:50'),
(22, 10, 'NCC Bank Ltd', 10, '<p>National Credit and Commerce Bank Limited bears a unique history of its own. The organization started its journey in the financial sector of the country as an investment company back in 1985. The aim of the company was to mobilize resources from within and invest them in such way so as to develop country\'s Industrial and Trade Sector and playing a catalyst role in the formation of capital market as well. Its membership with the browse helped the company to a great extent in these regard. The company operated upto 1992 with 16 branches and thereafter with the permission of the Central Bank converted into a full fledged private commercial Bank in 1993 with paid up capital of Tk. 39.00 crore to serve the nation from a broader platform. Since its inception NCC Bank Ltd. has acquired commendable reputation by providing sincere personalized service to its customers in a technology based environment. The Bank has set up a new standard in financing in the Industrial, Trade and Foreign exchange business. Its various deposit &amp; credit products have also attracted the clients-both corporate and individuals who feel comfort in doing business with the Bank.</p>', 'images/clients/967logo-1.png', '2021-08-07 14:55:18', '2021-08-07 14:55:18'),
(23, 10, 'Bangladesh Commerce Bank Ltd.', 11, '<p>Bangladesh Commerce Bank Limited is known as a commercial bank. Like all commercial banks BCBL&rsquo;s core business is obtaining deposit and providing loans. It is a financial institution providing services for businesses, organizations and individuals. Service includes offering different types of deposit account such as current deposit accounts, saving deposit accounts and other scheme accounts as well as giving out loans to businesses and individuals.</p>\r\n<p>BCB make its profit by taking small, short-term, relatively liquid deposits and transforming these into small, medium, larger loans for short, medium and longer maturity loans. These processes of asset transformation generate net income for BCB. BCB also does investment banking though it is not considered its main business area.</p>\r\n<p>However, BCB is primarily engaged in deposit and lending activities to private and corporate clients in wholesale and retail banking. Other services typically include credit cards, mobile banking, custodial service and guarantees, cash management and settlement as well as trade finance.</p>', 'images/clients/793output-onlinepngtools (8).png', '2021-08-07 14:56:27', '2021-08-07 14:56:27'),
(24, 10, 'H&M', 12, '<p>We are a family of brands, driven by our desire to make great design available to everyone in a sustainable way. Together we offer fashion, design and services, that enable people to be inspired and to express their own personal style, making it easier to live in a more circular way.</p>', 'images/clients/646output-onlinepngtools (9).png', '2021-08-07 15:04:21', '2021-08-07 15:04:21'),
(25, 10, 'GTCL', 13, '<p>To gradually create the national gas grid for the uninterrupted transportation of natural gas in a safe, reliable and economical way to the demand centers for ultimate distribution of the same by the distribution companies is the vision of Gas Transmission Company Limited (GTCL). The mission is to continuously study the availability and demand of natural gas for meeting the primary energy need in the country; establish and operate required gas transportation facilities in a sound and efficient manner; build-up human resources; develop planning, design and operational standards consistent with world gas industry practice; and manage corporate and financial operations for sustained development of the company.</p>', 'images/clients/745output-onlinepngtools (10).png', '2021-08-07 15:10:35', '2021-08-07 15:10:35'),
(26, 10, 'Aristopharma Ltd.', 14, '<p>Aristopharma Ltd. is one of the top 10 pharmaceutical companies in Bangladesh. The company started its journey in 1986 with the honest promise to provide quality medicines at affordable prices to the countrymen.</p>', 'images/clients/768output-onlinepngtools (12).png', '2021-08-07 15:14:39', '2021-08-07 15:15:30'),
(27, 10, 'RAK Ceramics', 15, '<p>t RAK Ceramics we help to create icons, we help to build marvels and our products feature in some of the most iconic buildings in the world. We are known for our wide product range and our ability to produce bespoke ranges for both small and large scale projects, enabling our clients to bring their ideas to life. We respect, we inspire, we improve, we deliver; today, tomorrow, no matter the ambition, no matter the challenge, at RAK Ceramics we take care of all the details, however large or small, so you don&rsquo;t have to.<br />Our passion and expertise combined with this careful attention to detail enables us to provide you with a wide range of integrated ceramics solutions, allowing you freedom to be creative and plenty of room for imagination.</p>', 'images/clients/172logo-5.png', '2021-08-07 15:18:38', '2021-08-07 15:18:38'),
(28, 10, 'Sig Combibloc', 16, '<p>SIG is a leading systems and solutions provider for aseptic packaging. We work in partnership with our customers to bring food products to consumers around the world in a safe, sustainable and affordable way.</p>\r\n<p>Our unique technology and outstanding innovation capacity enable us to provide our customers with a complete range of packs, flexible filling machines and solutions for operating smarter factories, all to address the ever-changing needs of consumers.</p>\r\n<p>Founded 1853, SIG is headquartered in Neuhausen, Switzerland.&nbsp;</p>', 'images/clients/370output-onlinepngtools (13).png', '2021-08-07 15:21:11', '2021-08-07 15:21:11'),
(29, 10, 'Karim Group Hatirjheel project', 17, '<p>Karim Group Hatirjheel project</p>', 'images/clients/782output-onlinepngtools (14).png', '2021-08-07 15:22:55', '2021-08-07 15:22:55'),
(30, 10, 'Water & Life', 18, '<p>Water &amp; Life Bangladesh Business : Water &amp; Life Bangladesh (W&amp;L), a registered NGO, created by the French NGO Eau &amp; Vie is active in Bangladesh in the livelihood development of Urban Slum dwellers implementing water supply, firefighting, hygiene promotion, sanitation and solid waste management activities.<br />W&amp;L Bangladesh works in close association with the social business company Shobar Jonno Pani Ltd. (SJP), created by Eau &amp; Vie in 2010, specialized in water supply in urban slums of Bangladesh, aiming at creating quality-controlled, piped and metered water supply networks which are financially viable, socially responsible and adapted to the needs of urban poor.<br />Both W&amp;L and SJP are engaged in partnerships with the local communities, authorities, water operator and other development stakeholders.</p>', 'images/clients/332output-onlinepngtools (15).png', '2021-08-07 15:25:26', '2021-08-07 15:25:26'),
(31, 10, 'Next Space Ltd', 20, '<p>Next Spaces Limited was formed in 2004 by merging and consolidating into the solid background and successful accomplishment in the Engineering and Management of infrastructure projects. Next Spaces Limited is specialized in construction management especially in construction of commercial and industrial buildings, tall buildings with basement floors and specially foundation technology. Next Spaces Limited has dedicated to develop and manage the planning and construction of infrastructure project with the introduction of modern construction technology. The company is specialized in foundation construction, pile foundation, basement construction.</p>\r\n<p>Next Spaces Limited introduces hydraulic rotary system in bored pile construction. The company has the scope of doing CFA, secant pile, diaphragm wall in foundation technology. All the engineers and architects of Next Spaces Limited have outstanding experiences and unique background in the field of construction project.</p>\r\n<p>Next Spaces Limited always responses to the ever changing market requirements, through continuous research and development of new technologies and improvement of existing ones. The company delivers timely and early completion of projects.</p>\r\n<p>Next Spaces Limited has its head quarter in Dhaka city, Bangladesh, has been engaging in the construction of large projects, commercial and industrial buildings, residential buildings, multilevel basement project for the last decade. Pioneering in the field of foundation engineering, Next Spaces Limited has introduced technological innovations on foundation methods and technologies, such as large diameter bored pile, CFA pile, secant pile, diaphragm wall, tie back anchor system, jet grout, and micro piles. Next Spaces Limited has been known since inception for targeting and consistently achieving a high degree of customer satisfaction, early project completion, high quality of work standard, sound management.</p>', 'images/clients/937output-onlinepngtools (16).png', '2021-08-07 18:37:45', '2021-08-07 18:37:45'),
(32, 10, 'Nexton Developments Ltd', 21, '<p>Nexton Developments Ltd</p>', 'images/clients/992output-onlinepngtools (17).png', '2021-08-07 18:42:11', '2021-08-07 18:42:11'),
(33, 10, 'Swantex Ltd', 22, '<p>Swantex Ltd</p>', 'images/clients/470output-onlinepngtools (18).png', '2021-08-07 18:45:14', '2021-08-07 18:45:14'),
(34, 10, 'SOS Vocational Training Centre Dhaka', 23, '<p>SOS Vocational Training Centre Dhaka</p>', 'images/clients/914output-onlinepngtools (19).png', '2021-08-07 18:47:59', '2021-08-07 18:47:59'),
(35, 10, 'Bijoy Rakeen City', 24, '<p>Bijoy Rakeen City</p>', 'images/clients/837output-onlinepngtools (20).png', '2021-08-07 18:49:58', '2021-08-07 18:49:58'),
(36, 10, 'Sams Attire ltd.', 25, '<p>Sams Attire ltd.</p>', 'images/clients/482output-onlinepngtools (21).png', '2021-08-07 18:53:02', '2021-08-07 18:53:02'),
(37, 10, 'SOS HERMANN GMEINER COLLEGE DHAKA', 26, '<p>SOS HERMANN GMEINER COLLEGE DHAKA</p>', 'images/clients/986output-onlinepngtools (22).png', '2021-08-07 18:55:49', '2021-08-07 18:55:49'),
(38, 10, 'A K Khan & Company Limited', 28, '<p>A K Khan &amp; Company Limited</p>', 'images/clients/161output-onlinepngtools (23).png', '2021-08-07 19:05:46', '2021-08-07 19:05:46'),
(39, 10, 'DESCO', 29, '<p>DESCO</p>', 'images/clients/732output-onlinepngtools (24).png', '2021-08-07 19:06:42', '2021-08-07 19:06:42');
