INSERT INTO `ethical_codes` (`ethical_code_id`, `ethical_code_heading`, `ethical_code_description`, `created_at`, `updated_at`) VALUES
(9, 'Message from the CEO', '<p>JSS Services Ltd has heritage rooted in Dhaka, Bangladesh founded more than two decades ago. Over the years we have built a reputation for excellence in security and safety services and attention to and respect for the well-being of our employees and the communities in which we operate. As we continue to grow, innovate, build a culture based on the principles of respect and transparency, and be a transformative force in the security industry, it&rsquo;s our duty to our customers, our business associates, the communities we serve, and our Company to uphold the highest standard of ethical conduct, integrity, and compliance in all that we do.<br />This reputation is our most valuable asset, and our commitment to conducting business with integrity, honesty and fairness is the basis for all of our corporate values. A business doesn\'t last that long by cutting corners on quality, integrity, safety, or stewardship. &nbsp;Our leaders across the organization and our Board of Directors embrace the Code because it protects and advances two of our greatest assets: OUR PEOPLE and OUR BRANDS.<br />There\'s nothing better than working for a company where ethical conduct is expected and protected. All of us want to go to work each day knowing that we are asked to do what is lawful, reputable, and safe<br />We believe a company can succeed in today\'s highly competitive market only through a commitment to rock-solid values and ethical conduct. At JSS Services Ltd, we have a long-term perspective that values and protects the reputation of our company as an ethical and responsible business. We want our employees, contractors, customers, and communities to share in the benefits of upholding our reputation.</p>', '2021-09-01 09:31:25', '2021-09-01 09:31:25'),
(10, 'Introduction', '<p>This document sets out JSS Services Ltd (JSSSL) ethical Code of Conduct and states our enduring commitment to the highest ethical standards combined with strict adherence to national law. This is a legally binding document that explains the principles and ethical standards that apply to our staff.&nbsp;<br />JSSSL expects every employee, contractor, agent or any other person or company acting for or on our behalf to comply with this Code and in so doing, act with honesty and integrity whilst exercising good judgment.<br />&nbsp;At JSSSL, we place a strong emphasis on ethics, integrity and compliance. We want to be a good corporate citizen, and a strong and trusted partner to our shareholders, clients, employees and other stakeholders. JSSSL is strongly committed to upholding the highest ethical business standards and compliance with laws, rules and regulations.<br />Our Code applies to everyone. Our employees must be guided by our core values &ndash; Integrity, Vigilance and Helpfulness &ndash; be loyal, ethical and honest, have integrity and treat others with dignity, and respect and comply with our policies and the law.<br />While the Code provides guidance on how we are to act in an ethical and compliant way, it is not possible to cover every situation that may arise in the day-to-day business of JSSSL operations. Therefore, each employee and business partner has a responsibility to use his/her sound judgment and act in line with our values. As a complement to the Code, there are other more detailed policies and guidelines.</p>', '2021-09-01 09:32:47', '2021-09-01 09:32:47'),
(11, 'Our Value', '<p>JSS Services Ltd has only one purpose as a company, to make your world better by making it safe,&nbsp;<br />Our purpose reminds us that, every day when we go to work, we are contributing to something greater &ndash; our purpose is the reason we exist. Our purpose is at the very core of our strategy and it will help create value for us. It will help us sustain profitable growth, to remain relevant in a rapidly changing world, and deepen our ties with our stakeholders. Our operations are based on three core values: Integrity, Vigilance and Helpfulness<br />we believe in doing business the right way.<br />Our operations are based on three core values: Integrity, Vigilance and Helpfulness &bull;<br />Integrity: &nbsp;Integrity means being honest and acting in an ethical way. Securitas is uncompromising in its demands on integrity and truthfulness, and we insist on our employees&rsquo; right to openly express their opinions and their duty to report improprieties and other relevant information without risking reprisals.&nbsp;<br />Vigilance: Vigilance means actively paying attention. Our employees must be fully attentive and able to observe, listen and evaluate in order to protect our clients&rsquo; premises and property and the values and ethics that Securitas represents.<br />Helpfulness: Helpfulness means being service-oriented and accommodating to our clients, colleagues and others who require assistance, whenever needed.</p>', '2021-09-01 09:33:55', '2021-09-01 09:33:55'),
(12, 'Human Rights', '<p>&nbsp;Respect for human rights is vital to JSSSL and how we conduct our daily business. The JSSSL acknowledges that security is a fundamental need, shared by individuals, communities, businesses, and governments alike. While acknowledging that diffi&not;cult security issues are faced by private security companies, JSSSL recognizes that security and respect for Human Rights can and should be consistent.<br />JSSSL support and respect, when conducting business, the dignity of all human beings and will endeavor to observe all applicable international humanitarian and human rights laws.<br />JSSSL providing civilian private security services in areas of armed conflict shall respect the standards of international humanitarian and human rights laws applicable in each area.&nbsp;<br />Together with the JSSSL People and Diversity Policy and the JSSSL Human Rights Policy, the Code shows our commitment to respect human rights. As a security company, we recognize that we must carefully assess the potential risks of violating human rights through the services that we, our joint venture partners, suppliers and sub-contractors provide.</p>', '2021-09-01 09:34:34', '2021-09-01 09:34:34'),
(13, 'COMPLIANCE WITH LOCAL LAWS AND REGULATIONS', '<p>JSSSL shall carry out its private security operations in compliance with applicable laws and regulations governing the private security industry. JSSSL is a local company. All employees and business partners must always comply with the laws, rules and regulations of the local government. The Code represents the base and is to be followed in all of JSSSL operations. JSSSL establish reasonable procedures designed to prevent personnel with a criminal background demonstrating unsuitability to work in the security industry from being hired or deployed. JSSSL personnel will be trained in accordance with applicable legislation and/or licensing standards.<br />JSSSL will refrain from unlawful discrimination based on any applicable protected personal characteristics<br />JSSSL will prohibit its personnel from taking or offering bribes and will require that its personnel avoid any conflict of interest that might affect business decisions. We believe that corruption undermines legitimate business, distorts competition and brings serious risk to our brand and our reputation. JSSSL has zero tolerance for all forms of bribery and corruption, and we must never offer, solicit or receive bribes, other advantages, facilitation payments or other illegal payments to obtain or retain business. A bribe includes all financial or other advantages that are given, promised, offered, accepted, requested or received with the intention that a specific activity should be performed. &nbsp;<br />JSSSL will allow its personnel, without fear of reprisal, to raise serious concerns about illegal business practices or those which otherwise violate the Code.</p>', '2021-09-01 09:36:40', '2021-09-01 09:36:40');
INSERT INTO `founder_speeches` (`founder_speech_id`, `designation`, `description`, `image`, `created_at`, `updated_at`) VALUES
(17, 'Founder & Chairman', '<p>Founder and Chairman of J S S Services Ltd, a dynamic person with versatile career profile and a devoted businessman, who was commissioned from Pakistan Military Academy in the year 1968. After the Liberation war he served for Bangladesh Army. During his decorated service life he served in many important Military and Diplomatic positions such as General Staff Officer -1 in Army Head Quarter, Chief Instructor of Army School of Education and Administration, Chief Instructor of BDR (BGB) Training Centre &amp; School, Regiment Commander of Bangladesh National Cadet Corps and many other important posts. Besides business, he is a sincere social worker actively involved in numerous voluntary and philanthropic activities. Some of his noteworthy contributions towards society are founding Bogra Mahila College, Fulbaria Dakhil Madrasha, Fulbaria Primary School in Bogra. He is also the Cabinet member of Lions International District &ndash; 315A2, &amp; life member of RAOWA Club. His 32 years experiences in military services and 24 years experience in security services industry played a major role in turning this company into one of the leading security service providers of the country.</p>', 'images/founder-speach/1706532301810198.png', '2021-07-28 05:59:22', '2021-08-02 02:44:14');
INSERT INTO `hero_sections` (`id`, `title`, `description`, `image`, `created_at`, `updated_at`) VALUES
(4, '<p>A Leading Security Firm Having<span style=\"color: #9c0f0f;\"> 27 Years Experience</span> in the Security Field</p>', '<p>Dealing with trust and confidence not only in the Capital Market but across the country with utmost dedication. Since its inception in 1994 JSSSL is providing best services to the clients by a smart and dedicated working team with a high technical support</p>', 'hero-section/1706900105978448.png', '2021-08-01 07:48:38', '2021-08-02 01:51:48');
INSERT INTO `instructions` (`id`, `instructions`, `created_at`, `updated_at`) VALUES
(1, '<p><strong>অনলাইনে ফরম পুরনের নিয়মাবলীঃ</strong><br />\r\nপ্রার্থী যে পদে আবেদন করতে ইচ্ছুক, সেই পদের নাম উল্লেখ করে যাবতীয় তথ্যাদি পূরণপূর্বক ছবি (300x300 Pixel), স্বাক্ষরসহ (300x80 Pixel) আবেদন করতে হবে। (প্রার্থীর জাতীয় পরিচয়পত্র নম্বর এবং মোবাইল নম্বর অবশ্যই উল্লেখ করতে হবে)। প্রাথমিক তালিকাভুক্তির পর বাছাইকৃতদের পরীক্ষার স্থান, তারিখ ও সময় মোবাইলে SMS এর মাধ্যমে জানিয়ে দেওয়া হবে। লিখিত, ব্যবহারিক ও মৌখিক পরীক্ষায় উত্তীর্ণদের মেধাক্রম অনুযায়ী নিয়োগ দেওয়া হবে। সকল প্রয়োজনীয় ডকুমেন্টের মূলকপি ও ১ সেট সত্যায়িত ফটোকপি মৌখিক পরীক্ষার সময় সাথে আনতে হবে। পরীক্ষায় &nbsp;অংশগ্রহনের জন্য কোন প্রকার টিএ/ডিএ প্রদান করা হবে না। আবেদনের সময়সীমা আগামী ০৩-১০-২০২১ ইং তারিখ রাত ১১.৫৯টা পর্যন্ত।</p>', '2021-09-10 03:54:47', '2021-09-28 16:04:37'),
