INSERT INTO `news` (`news_id`, `news_title`, `news_description`, `news_image`, `news_published_at`, `created_at`, `updated_at`) VALUES
(16, 'JSSSL Empowers Transgender Community', '<p>[Dhaka, 01 March 2021]- JSS Security Services Ltd (JSSSL), the most professional security leader of the<br />\r\nindustry, have recently transgender security guards to work for the world&rsquo;s second-largest fashion<br />\r\nretailer, the H&amp;amp;M Group.<br />\r\nThis is the very first time for members of the transgender community in Bangladesh to be integrated<br />\r\ninto the local safety and security service industry. We believe, that this important step will help to<br />\r\nspread awareness around the importance of breaking stereotypes and to provide equal employment<br />\r\nopportunities for all.<br />\r\nTransgender activist Ananya Banik says: &ldquo;The transgender community and its members have long been<br />\r\nneglected and abused to the extent that their identities and inheritance have been denied up until<br />\r\nrecently. But things are changing. I hope more organizations work towards integrating the community,<br />\r\nempowering and enabling them in the process.&rdquo;<br />\r\nH&amp;amp;M&rsquo;s Regional Country Manager Mr. Ziaur Rahman says: &ldquo;At H&amp;amp;M Group we encourage people to be<br />\r\nthemselves and to respect others for who they are. We believe in being inclusive and promoting diversity<br />\r\nin all aspects of our business and across our value chain. This also includes providing inclusive and equal<br />\r\nemployment opportunities. This is why I am very happy to share with you some concrete steps we have<br />\r\ntaken together with our service providers, to create new employment opportunities for people identifying<br />\r\nthemselves as transgender. H&amp;amp;M Group is breaking gender stereotypes in Bangladesh by hiring eight<br />\r\ntransgender people as security guards through their partners. Although this is just a first step, it is an<br />\r\nimportant one, which will hopefully be scalable and an inspiration to our suppliers and other companies<br />\r\nto do the same. We warmly welcome our new colleagues and look forward to a more inclusive future.&rdquo;<br />\r\nRegarding the integration of the third gender community into the safety and security industry, &hellip;&hellip; of<br />\r\nJSSSL says: &ldquo;In Bangladesh, Gender Diverse Population are socially excluded- living on the fringes of<br />\r\nsociety, often harassed and abused by different variables of society. We have been trying to take an<br />\r\ninitiative such as this for a long time to integrate this potent man power into our society, as it ideally<br />\r\nshould be.&rdquo;<br />\r\n&ldquo;The objective of hiring this community through the initiative is not just about creating awareness on<br />\r\nthird gender issues, but establishing their human dignity in the society by empowering them to be self-<br />\r\ndependent,&rdquo; he added.<br />\r\nIt is noteworthy, the Bangladesh government under the leadership Prime Minister Sheikh Hasina told a<br />\r\ncabinet meeting in November 2020 that new inheritance laws for transgender people are being drafted;<br />\r\nto address the social inequality towards the community.</p>', 'images/news/434Photo.jpg', '2021-03-01', '2021-09-06 09:35:54', '2021-09-06 09:35:54'),
