(19, '<ul>\r\n	<li>One of the Pioneers of the Security Industry with 24 Years Experience.</li>\r\n	<li>Trust, Honesty, Reliability Is What Makes Jsssl Successful.</li>\r\n	<li>We Provide Customized Security Solutions to Our Clients.</li>\r\n	<li>We Value Our Ability to Act Instantly, No Matter What the Situation Is.</li>\r\n	<li>We Are Quicker to Response Under Any Circumstances All over the Country</li>\r\n	<li>We Are Capable of Handling Extremely Challenging and High Risk Situations.</li>\r\n</ul>', '2021-07-14 08:43:30', '2021-09-09 03:29:44'),
(20, '<ul>\r\n	<li>One of the Pioneers of the Security Industry with 24 Years Experience.</li>\r\n	<li>Trust, Honesty, Reliability Is What Makes Jsssl Successful.</li>\r\n	<li>We Provide Customized Security Solutions to Our Clients.</li>\r\n	<li>We Value Our Ability to Act Instantly, No Matter What the Situation Is.</li>\r\n	<li>We Are Quicker to Response Under Any Circumstances All over the Country</li>\r\n	<li>We Are Capable of Handling Extremely Challenging and High Risk Situations.</li>\r\n</ul>', '2021-07-14 23:48:41', '2021-09-09 03:31:05'),
(21, '<p>JSSSL security guards are exceptionally trained and equipped to provide excellent service maintaining all protocol.&amp;nbsp;</p>', '2021-07-15 06:06:01', '2021-08-03 23:06:18'),
