(25, '<p>sd</p>', '2021-08-01 06:42:34', '2021-08-01 06:42:34'),
(26, '<p>sdsdsThe Manager joins a department of part psychologists, part scientists, part artists, part entrepreneurs, and part politicians. We strategize how brands should communicate with people across the myriad of media channels, and how to do that differently from every other brand. You will assist in the planning, implementing and the maintenance of holistic media campaigns with the ability to assist in both the higher-level strategy as well as the implementation/execution of a media plan. You will manage direct client relationships as well as train and manage Planners and Associates in all media planning functions.</p>', '2021-08-02 01:37:53', '2021-08-02 01:39:55'),
(27, '<p>The Manager joins a department of part psychologists, part scientists, part artists, part entrepreneurs, and part politicians. We strategize how brands should communicate with people across the myriad of media channels, and how to do that differently from every other brand. You will assist in the planning, implementing and the maintenance of holistic media campaigns with the ability to assist in both the higher-level strategy as well as the implementation/execution of a media plan. You will manage direct client relationships as well as train and manage Planners and Associates in all media planning functions.</p>', '2021-08-02 01:40:16', '2021-08-02 01:40:16'),
(28, '<ul>\r\n	<li>One of the Pioneers of the Security Industry with 24 Years Experience.</li>\r\n	<li>Trust, Honesty, Reliability Is What Makes Jsssl Successful.</li>\r\n	<li>We Provide Customized Security Solutions to Our Clients.</li>\r\n	<li>We Value Our Ability to Act Instantly, No Matter What the Situation Is.</li>\r\n	<li>We Are Quicker to Response Under Any Circumstances All over the Country</li>\r\n	<li>We Are Capable of Handling Extremely Challenging and High Risk Situations.</li>\r\n</ul>', '2021-08-03 23:07:54', '2021-09-09 03:29:58'),
(29, '<p>An Engineer, or Senior Engineer, uses math and science to solve different technical problems. Their main duties include developing new products for companies or individuals to use, providing maintenance to current products to enhance use and designing new machines to improve an organization\'s efficiencies.</p>', '2021-08-03 23:08:43', '2021-08-03 23:08:43'),
(30, '<p>Under general supervision (Accountant I) or direction (Accountant II), performs a variety of professional level accounting duties involved in preparing, maintaining, analyzing, verifying, and reconciling complex financial transactions, statements, records, and reports.</p>', '2021-08-03 23:09:20', '2021-08-03 23:09:20'),
(31, '<ul>\r\n	<li><strong>নূন্যতম এইচ এস সি বা সমমান পাস হতে হবে l</strong></li>\r\n	<li><strong>যে কোন স্বীকৃত প্রশিক্ষণ ইনস্টিটিউট হতে কম্পিউটার ডিপ্লোমা থাকতে হবে l</strong></li>\r\n	<li><strong>নির্বাচন কমিশনের প্রকল্পে অভিজ্ঞতাসম্পন্ন প্রার্থীদের &nbsp;অগ্রাধিকার দেয়া হবে&nbsp;&nbsp;l</strong></li>\r\n</ul>', '2021-08-03 23:09:48', '2021-09-28 16:04:37'),
(32, '<p>A Cashier\'s primary role is to assist customers in the in-store check-out process.</p>', '2021-08-03 23:10:18', '2021-08-03 23:10:18'),
(33, '<p>Logistics managers or distribution managers are responsible for coordinating the storage, transportation and delivery of goods. Logistics managers oversee and liaise with colleagues to ensure stock is maintained and moved efficiently.</p>', '2021-08-03 23:11:01', '2021-08-03 23:11:01'),
(34, '<p>An Administrator provides office support to either an individual or team and is vital for the smooth-running of a business. Their duties may include fielding telephone calls, receiving and directing visitors, word processing, creating spreadsheets and presentations, and filing.</p>', '2021-08-03 23:11:23', '2021-08-03 23:11:23'),
(35, '<p>A utility manager, also known as a public works director, oversees the operations and maintenance of the systems responsible for water treatment, wastewater collection, and water distribution to a localized community.</p>', '2021-08-03 23:11:46', '2021-08-03 23:11:46'),
(36, '<p>Maintains office operations by receiving and distributing communications; collecting and mailing correspondence and copying information. Maintains office schedule by picking up and delivering items as needed. Updates job knowledge by participating in educational opportunities.</p>', '2021-08-03 23:12:11', '2021-08-03 23:12:11'),
(37, '<p>Leading company based in Bangladesh is looking for Tea Boy who can join immediately.</p>', '2021-08-03 23:12:34', '2021-08-03 23:12:34'),
(38, '<p>A Cleaners role can vary depending on their working environment.&amp;nbsp;</p>', '2021-08-03 23:13:11', '2021-08-03 23:13:11'),
(39, '<p>Drivers are responsible for transporting clients or handling deliveries in a timely manner, and they may have to work nights and weekends to accomplish their duties.</p>', '2021-08-03 23:13:40', '2021-08-03 23:13:40'),
(40, '<p>Customer Service Operators work in call centers and provide support to customers via the telephone.</p>', '2021-08-03 23:14:10', '2021-08-03 23:14:10'),
(41, '<p>Plumbers are required to complete a high school diploma and an apprenticeship program. Most states require plumbers to be licensed. Taking vocational courses in high school can help prepare candidates planning to enter this job market.</p>', '2021-08-03 23:14:36', '2021-08-03 23:14:36'),
(42, '<p>Electricians need talent, knowledge, and the right spirit. They need to think on their feet, feel comfortable in a classroom, and possess precise communication skills. It\'s a tough job, there\'s no doubt.</p>', '2021-08-03 23:15:01', '2021-08-03 23:15:01'),
(43, '<p>Promoter is a marketing professional responsible for demonstrating the features of a product to an audience or client. Promoter shows how the product works, takes questions and attempts to persuade consumers or clients to buy the product.</p>', '2021-08-03 23:15:43', '2021-08-03 23:15:43'),
(44, '<ul>\r\n	<li><strong>নূন্যতম এইচ এস সি বা সমমান পাস হতে হবে l</strong></li>\r\n	<li><strong>যে কোন স্বীকৃত প্রশিক্ষণ ইনস্টিটিউট হতে কম্পিউটার ডিপ্লোমা থাকতে হবে l</strong></li>\r\n	<li><strong>নির্বাচন কমিশনের প্রকল্পে অভিজ্ঞতাসম্পন্ন প্রার্থীদের &nbsp;অগ্রাধিকার দেয়া হবে&nbsp;&nbsp;l</strong></li>\r\n</ul>', '2021-09-08 14:20:45', '2021-09-10 10:47:05'),
(45, '<ul>\r\n	<li><strong>নূন্যতম এইচ. এস. সি বা সমমান পাস হতে হবে l</strong></li>\r\n	<li><strong>&nbsp;যে কোন স্বীকৃত প্রশিক্ষণ ইনস্টিটিউট হতে কম্পিউটার ডিপ্লোমা থাকতে হবে l</strong></li>\r\n	<li><strong>নির্বাচন কমিশনের প্রকল্পে অভিজ্ঞতাসম্পন্ন প্রার্থীদের &nbsp;অগ্রাধিকার দেয়া হবে</strong></li>\r\n</ul>', '2021-09-08 14:21:41', '2021-09-08 14:21:41'),
