(26, '<p>sdsdThe Manager joins a department of part psychologists, part scientists, part artists, part entrepreneurs, and part politicians. We strategize how brands should communicate with people across the myriad of media channels, and how to do that differently from every other brand. You will assist in the planning, implementing and the maintenance of holistic media campaigns with the ability to assist in both the higher-level strategy as well as the implementation/execution of a media plan. You will manage direct client relationships as well as train and manage Planners and Associates in all media planning functions.</p>', '2021-08-02 01:37:53', '2021-08-02 01:39:55'),
(27, '<p>The Manager joins a department of part psychologists, part scientists, part artists, part entrepreneurs, and part politicians. We strategize how brands should communicate with people across the myriad of media channels, and how to do that differently from every other brand. You will assist in the planning, implementing and the maintenance of holistic media campaigns with the ability to assist in both the higher-level strategy as well as the implementation/execution of a media plan. You will manage direct client relationships as well as train and manage Planners and Associates in all media planning functions.</p>', '2021-08-02 01:40:16', '2021-08-02 01:40:16'),
(28, '<ul>\r\n	<li>Trust, Honesty, reliability is what makes JSSSL successful.</li>\r\n	<li>\r\n	<p>We provide customized security solutions to our clients.</p>\r\n	</li>\r\n	<li>\r\n	<p>We value our ability to act instantly, no matter what the situation is.</p>\r\n	</li>\r\n	<li>We are quicker to response under any circumstances all over the country</li>\r\n	<li>We are capable of handling extremely challenging and high risk situations.</li>\r\n	<li>Top-Notch service quality.</li>\r\n	<li>Our flexibility to work to your needs is what our clients and customers value immensely.</li>\r\n	<li>Don&rsquo;t just believe us- Believe our satisfied customers.</li>\r\n</ul>', '2021-08-03 23:07:54', '2021-09-09 03:29:58'),
(29, '<p>An Engineer, or Senior Engineer, uses math and science to solve different technical problems. Their main duties include developing new products for companies or individuals to use, providing maintenance to current products to enhance use and designing new machines to improve an organization\'s efficiencies.</p>', '2021-08-03 23:08:43', '2021-08-03 23:08:43'),
(30, '<p>Under general supervision (Accountant I) or direction (Accountant II), performs a variety of professional level accounting duties involved in preparing, maintaining, analyzing, verifying, and reconciling complex financial transactions, statements, records, and reports.</p>', '2021-08-03 23:09:20', '2021-08-03 23:09:20'),
(31, '<ul>\r\n	<li><strong>সংশ্লিষ্ট &nbsp;উপজেলা / থানা নির্বাচন অফিসারের অধীনে ডাটা এন্ট্রি কন্ট্রোল সুপারভাইজারের তত্বাবধানে থেকে কার্যক্রম সম্পাদন করবেন l</strong></li>\r\n	<li><strong>জাতীয় পরিচয়পত্র ও ভোটার নিবন্ধন ও স্থানান্তর সংক্রান্ত সকল আবেদন গ্রহণকরা l</strong></li>\r\n	<li><strong>সকল প্রকার ডাটা এন্ট্রি করা l</strong></li>\r\n	<li><strong>সেবাগ্রহীতা নাগরিককে তার চাহিত সেবা / আবেদনের অসম্পূর্ণতা বিনয়ের সাথে ব্যাখ্যা করবেন এবং আবেদন সম্পূর্ণ &nbsp;করণে সহায়তা প্রদান করবেন l</strong></li>\r\n	<li><strong>সেবাগ্রহীতা কোনো ঊর্ধ্বতন কর্মকর্তার সাক্ষাত চাইলে সংশ্লিষ্ট &nbsp;কর্মকর্তার অনুমতিক্রমে তার ব্যবস্থা নিবেন l</strong></li>\r\n	<li><strong>হারানো কার্ডের আবেদন আপলোড করা ও কার্ড বিতরণ করা l</strong></li>\r\n	<li><strong>ভোটার তালিকা ও জাতীয় পরিচয়পত্র বিষয়ক যে কোন &nbsp;কাজ উর্ধ্বতনের নির্দেশনা অনুযায়ী সম্পাদন করবেন l</strong></li>\r\n	<li><strong>ঊর্ধ্বতন কর্মকর্তার নির্দেশে প্রকল্পের স্বার্থে যে কোন ধরণের দায়িত্ব পালন করতে বাধ্য থাকবেন l</strong></li>\r\n	<li><strong>সংশ্লিষ্ট শাখার আইসিটি ইকুইপমেন্ট ইনস্টলেশন, রক্ষণাবেক্ষন নিশ্চিত করবেন l</strong></li>\r\n	<li><strong>ভোটার তালিকা ও জাতীয় পরিচয়পত্র বিষয়ক যে কোনো কাজ নির্দেশনা অনুযায়ী সম্পাদন করবেন l</strong></li>\r\n	<li><strong>চিঠিপত্র টাইপকরণে কর্মকর্তাদের প্রয়োজনীয় সহায়তা প্রদান&nbsp;&nbsp;l</strong></li>\r\n</ul>', '2021-08-03 23:09:48', '2021-09-28 16:04:37'),
(32, '<p>A Cashier\'s primary role is to assist customers in the in-store check-out process.</p>', '2021-08-03 23:10:18', '2021-08-03 23:10:18'),
(33, '<p>Logistics managers or distribution managers are responsible for coordinating the storage, transportation and delivery of goods. Logistics managers oversee and liaise with colleagues to ensure stock is maintained and moved efficiently.</p>', '2021-08-03 23:11:01', '2021-08-03 23:11:01'),
(34, '<p>An Administrator provides office support to either an individual or team and is vital for the smooth-running of a business. Their duties may include fielding telephone calls, receiving and directing visitors, word processing, creating spreadsheets and presentations, and filing.</p>', '2021-08-03 23:11:23', '2021-08-03 23:11:23'),
(35, '<p>A utility manager, also known as a public works director, oversees the operations and maintenance of the systems responsible for water treatment, wastewater collection, and water distribution to a localized community.</p>', '2021-08-03 23:11:46', '2021-08-03 23:11:46'),
(36, '<p>Maintains office operations by receiving and distributing communications; collecting and mailing correspondence and copying information. Maintains office schedule by picking up and delivering items as needed. Updates job knowledge by participating in educational opportunities.</p>', '2021-08-03 23:12:11', '2021-08-03 23:12:11'),
(37, '<p>Leading company based in Bangladesh is looking for Tea Boy who can join immediately.</p>', '2021-08-03 23:12:34', '2021-08-03 23:12:34'),
(38, '<p>A Cleaners role can vary depending on their working environment.&amp;nbsp;</p>', '2021-08-03 23:13:11', '2021-08-03 23:13:11'),
(39, '<p>Drivers are responsible for transporting clients or handling deliveries in a timely manner, and they may have to work nights and weekends to accomplish their duties.</p>', '2021-08-03 23:13:40', '2021-08-03 23:13:40'),
(40, '<p>Customer Service Operators work in call centers and provide support to customers via the telephone.</p>', '2021-08-03 23:14:10', '2021-08-03 23:14:10'),
(41, '<p>Plumbers are required to complete a high school diploma and an apprenticeship program. Most states require plumbers to be licensed. Taking vocational courses in high school can help prepare candidates planning to enter this job market.</p>', '2021-08-03 23:14:36', '2021-08-03 23:14:36'),
(42, '<p>Electricians need talent, knowledge, and the right spirit. They need to think on their feet, feel comfortable in a classroom, and possess precise communication skills. It\'s a tough job, there\'s no doubt.</p>', '2021-08-03 23:15:01', '2021-08-03 23:15:01'),
(43, '<p>Promoter is a marketing professional responsible for demonstrating the features of a product to an audience or client. Promoter shows how the product works, takes questions and attempts to persuade consumers or clients to buy the product.</p>', '2021-08-03 23:15:43', '2021-08-03 23:15:43'),
(44, '<ul>\r\n	<li><strong>সংশ্লিষ্ট &nbsp;উপজেলা / থানা নির্বাচন অফিসারের অধীনে ডাটা এন্ট্রি কন্ট্রোল সুপারভাইজারের তত্বাবধানে থেকে কার্যক্রম সম্পাদন করবেন l</strong></li>\r\n	<li><strong>জাতীয় পরিচয়পত্র ও ভোটার নিবন্ধন ও স্থানান্তর সংক্রান্ত সকল আবেদন গ্রহণকরা l</strong></li>\r\n	<li><strong>সকল প্রকার ডাটা এন্ট্রি করা l</strong></li>\r\n	<li><strong>সেবাগ্রহীতা নাগরিককে তার চাহিত সেবা / আবেদনের অসম্পূর্ণতা বিনয়ের সাথে ব্যাখ্যা করবেন এবং আবেদন সম্পূর্ণ &nbsp;করণে সহায়তা প্রদান করবেন l</strong></li>\r\n	<li><strong>সেবাগ্রহীতা কোনো ঊর্ধ্বতন কর্মকর্তার সাক্ষাত চাইলে সংশ্লিষ্ট &nbsp;কর্মকর্তার অনুমতিক্রমে তার ব্যবস্থা নিবেন l</strong></li>\r\n	<li><strong>হারানো কার্ডের আবেদন আপলোড করা ও কার্ড বিতরণ করা l</strong></li>\r\n	<li><strong>ভোটার তালিকা ও জাতীয় পরিচয়পত্র বিষয়ক যে কোন &nbsp;কাজ উর্ধ্বতনের নির্দেশনা অনুযায়ী সম্পাদন করবেন l</strong></li>\r\n	<li><strong>ঊর্ধ্বতন কর্মকর্তার নির্দেশে প্রকল্পের স্বার্থে যে কোন ধরণের দায়িত্ব পালন করতে বাধ্য থাকবেন l</strong></li>\r\n	<li><strong>সংশ্লিষ্ট শাখার আইসিটি ইকুইপমেন্ট ইনস্টলেশন, রক্ষণাবেক্ষন নিশ্চিত করবেন l</strong></li>\r\n	<li><strong>ভোটার তালিকা ও জাতীয় পরিচয়পত্র বিষয়ক যে কোনো কাজ নির্দেশনা অনুযায়ী সম্পাদন করবেন l</strong></li>\r\n	<li><strong>চিঠিপত্র টাইপকরণে কর্মকর্তাদের প্রয়োজনীয় সহায়তা প্রদান&nbsp;&nbsp;l</strong></li>\r\n</ul>', '2021-09-08 14:20:45', '2021-09-10 10:47:05'),
(45, '<ul>\r\n	<li><strong>মাঠপর্যায় হতে প্রাপ্ত জাতীয় পরিচয়পত্র ও ভোটার নিবন্ধন সংক্রান্ত সকল আবেদন সমূহের নোট সিট প্রস্তুত কর্মকর্তাদের সহায়তা প্রদান l</strong></li>\r\n	<li><strong>চিঠিপত্র টাইপ করণে &nbsp;কর্মকর্তাদের প্রয়োজনীয় সহায়তা প্রদান l&nbsp;</strong></li>\r\n	<li><strong>প্রকল্প কার্যালয়ে প্রাপ্ত নতুন নিবন্ধন, সংশোধন, হারানো ইত্যাদি আবেদন গ্রহণ &nbsp;এবং আবেদনসমূহের ডাটা এন্ট্রি ও আপলোড করা l</strong></li>\r\n	<li><strong>ভুল সংক্রান্ত নথিপত্র যাচাই বাছাইকরনে কর্মকর্তাদের সহায়তা প্রদান l</strong></li>\r\n	<li><strong>সেবাগৃহীতা নাগরিককে তার চাহিত সেবা / আবেদনের অসম্পূর্ণতা বিনয়ের সাথে ব্যাখ্যা করবেন এবং আবেদন সম্পূর্ণকরণে সহায়তা প্রদান করবেন l</strong></li>\r\n	<li><strong>ভোটার তালিকা ও জাতীয় পরিচয়পত্র বিষয়ক যে কোন কাজ নির্দেশনা অনুযায়ী সম্পাদন করবেন l</strong></li>\r\n	<li><strong>সংশ্লিষ্ট &nbsp;শাখার আইসিটি &nbsp;ইকুইপমেন্ট ইনস্টলেশন, রক্ষণাবেক্ষণ করবেন l</strong></li>\r\n	<li><strong>ঊর্ধ্বতন কর্মকর্তার নির্দেশে প্রকল্পের স্বার্থে যে কোন ধরনের দায়িত্ব পালন করতে বাধ্য থাকবেন l</strong></li>\r\n</ul>', '2021-09-08 14:21:41', '2021-09-08 14:21:41'),
(46, '<ul>\r\n	<li><strong>সংশ্লিষ্ট &nbsp;উপজেলা / থানা নির্বাচন অফিসারের অধীনে ডাটা এন্ট্রি কন্ট্রোল সুপারভাইজারের তত্বাবধানে থেকে কার্যক্রম সম্পাদন করবেন l</strong></li>\r\n	<li><strong>জাতীয় পরিচয়পত্র ও ভোটার নিবন্ধন ও স্থানান্তর সংক্রান্ত সকল আবেদন গ্রহণকরা l</strong></li>\r\n	<li><strong>সকল প্রকার ডাটা এন্ট্রি করা l</strong></li>\r\n	<li><strong>সেবাগ্রহীতা নাগরিককে তার চাহিত সেবা / আবেদনের অসম্পূর্ণতা বিনয়ের সাথে ব্যাখ্যা করবেন এবং আবেদন সম্পূর্ণ &nbsp;করণে সহায়তা প্রদান করবেন l</strong></li>\r\n	<li><strong>সেবাগ্রহীতা কোনো ঊর্ধ্বতন কর্মকর্তার সাক্ষাত চাইলে সংশ্লিষ্ট &nbsp;কর্মকর্তার অনুমতিক্রমে তার ব্যবস্থা নিবেন l</strong></li>\r\n	<li><strong>হারানো কার্ডের আবেদন আপলোড করা ও কার্ড বিতরণ করা l</strong></li>\r\n	<li><strong>ভোটার তালিকা ও জাতীয় পরিচয়পত্র বিষয়ক যে কোন &nbsp;কাজ উর্ধ্বতনের নির্দেশনা অনুযায়ী সম্পাদন করবেন l</strong></li>\r\n	<li><strong>ঊর্ধ্বতন কর্মকর্তার নির্দেশে প্রকল্পের স্বার্থে যে কোন ধরণের দায়িত্ব পালন করতে বাধ্য থাকবেন l</strong></li>\r\n	<li><strong>সংশ্লিষ্ট শাখার আইসিটি ইকুইপমেন্ট ইনস্টলেশন, রক্ষণাবেক্ষন নিশ্চিত করবেন l</strong></li>\r\n	<li><strong>ভোটার তালিকা ও জাতীয় পরিচয়পত্র বিষয়ক যে কোনো কাজ নির্দেশনা অনুযায়ী সম্পাদন করবেন l</strong></li>\r\n	<li><strong>চিঠিপত্র টাইপকরণে কর্মকর্তাদের প্রয়োজনীয় সহায়তা প্রদান&nbsp;&nbsp;l</strong></li>\r\n</ul>', '2021-09-08 14:29:36', '2021-09-10 10:48:41'),
(47, '<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li><strong>সকল ড্রাইভারকে প্রকল্প পরিচালক কর্তৃক নিযুক্ত ভারপ্রাপ্ত কর্মকর্তার নিকট রিপোর্ট করতে হবে সকল ড্রাইভারকে প্রকল্প কর্তৃক নির্দেশিত দায়িত্বসমূহ যথাযথভাবে পালন করতে হবে l</strong></li>\r\n	<li><strong>সকল ড্রাইভারকে তাদের নামে বরাদ্দকৃত গাড়িসমূহের নিয়মিত পরিষ্কার পরিছন্নতার, রক্ষনাবেক্ষন এর জন্য দায়বদ্ধ থাকতে হবে l</strong></li>\r\n	<li><strong>সকল ড্রাইভারকে দায়িত্ব পালনকালীন সময় &quot;Service Provider&quot; কর্তৃক ইস্যুকৃত ইউনিফর্ম পরিধান করতে হবে l</strong></li>\r\n	<li><strong>ড্রাইভারগণকে অফিস সময় &nbsp;শুরু &nbsp;হওয়ার কমপক্ষে এক ঘন্টা পূর্বে আদেশকৃত স্থানে বা অফিসে যোগদান করতে হবে l</strong></li>\r\n	<li><strong>সংশ্লিষ্ট কর্মকর্তার দায়িত্বপালন কিংবা নির্ধারিত দায়িত্ব পালনের জন্য গ্যারেজ হতে গাড়ি গ্রহণের পূর্বে প্রয়োজনীয় সকল প্রকার চেকিং করে নিতে হবে l</strong></li>\r\n	<li><strong>অফিস সময় শেষ না হওয়া পর্যন্ত &nbsp;সকল ড্রাইভারকে সংশ্লিষ্ট কর্মকর্তাগণ এর জন্য অপেক্ষামান থাকতে হবে l</strong></li>\r\n	<li><strong>দায়িত্ব পালন শেষে অফিস ত্যাগ করার পূর্বে সংশ্লিষ্ট গাড়ি নির্ধারিত গ্যারেজে পার্কিং / জমা দেয়ার সময় ফাইনালি একবার প্রয়োজনীয় চেক আপ &nbsp;করে গাড়ি গ্যারেজে রাখতে হবে l</strong></li>\r\n	<li><strong>সকল ড্রাইভারকে গাড়ির প্রয়োজনীয় ডকুমেন্টস যেমনঃ গাড়ীর লগ বুক, হালনাগাদ &nbsp;ট্যাক্স টোকেন, ফিটনেস সনদ, গাড়ীর ব্লু বুক ও ড্রাইভিং লাইসেন্স সঙ্গে সংরক্ষণ করতে হবে l</strong></li>\r\n	<li><strong>সকল ড্রাইভারকে সব সময় গাড়ির সুরক্ষা নিশ্চিত করতে হবে&nbsp; l</strong></li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>', '2021-09-08 14:29:36', '2021-09-08 14:29:36'),
(48, '<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li><strong>সকল ড্রাইভারকে প্রকল্প পরিচালক কর্তৃক নিযুক্ত ভারপ্রাপ্ত কর্মকর্তার নিকট রিপোর্ট করতে হবে সকল ড্রাইভারকে প্রকল্প কর্তৃক নির্দেশিত দায়িত্বসমূহ যথাযথভাবে পালন করতে হবে l</strong></li>\r\n	<li><strong>সকল ড্রাইভারকে তাদের নামে বরাদ্দকৃত গাড়িসমূহের নিয়মিত পরিষ্কার পরিছন্নতার, রক্ষনাবেক্ষন এর জন্য দায়বদ্ধ থাকতে হবে l</strong></li>\r\n	<li><strong>সকল ড্রাইভারকে দায়িত্ব পালনকালীন সময় &quot;Service Provider&quot; কর্তৃক ইস্যুকৃত ইউনিফর্ম পরিধান করতে হবে l</strong></li>\r\n	<li><strong>ড্রাইভারগণকে অফিস সময় &nbsp;শুরু &nbsp;হওয়ার কমপক্ষে এক ঘন্টা পূর্বে আদেশকৃত স্থানে বা অফিসে যোগদান করতে হবে l</strong></li>\r\n	<li><strong>সংশ্লিষ্ট কর্মকর্তার দায়িত্বপালন কিংবা নির্ধারিত দায়িত্ব পালনের জন্য গ্যারেজ হতে গাড়ি গ্রহণের পূর্বে প্রয়োজনীয় সকল প্রকার চেকিং করে নিতে হবে l</strong></li>\r\n	<li><strong>অফিস সময় শেষ না হওয়া পর্যন্ত &nbsp;সকল ড্রাইভারকে সংশ্লিষ্ট কর্মকর্তাগণ এর জন্য অপেক্ষামান থাকতে হবে l</strong></li>\r\n	<li><strong>দায়িত্ব পালন শেষে অফিস ত্যাগ করার পূর্বে সংশ্লিষ্ট গাড়ি নির্ধারিত গ্যারেজে পার্কিং / জমা দেয়ার সময় ফাইনালি একবার প্রয়োজনীয় চেক আপ &nbsp;করে গাড়ি গ্যারেজে রাখতে হবে l</strong></li>\r\n	<li><strong>সকল ড্রাইভারকে গাড়ির প্রয়োজনীয় ডকুমেন্টস যেমনঃ গাড়ীর লগ বুক, হালনাগাদ &nbsp;ট্যাক্স টোকেন, ফিটনেস সনদ, গাড়ীর ব্লু বুক ও ড্রাইভিং লাইসেন্স সঙ্গে সংরক্ষণ করতে হবে l</strong></li>\r\n	<li><strong>সকল ড্রাইভারকে সব সময় গাড়ির সুরক্ষা নিশ্চিত করতে হবে&nbsp; l</strong></li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>', '2021-09-08 14:31:48', '2021-09-08 14:31:48'),
(49, '<ul>\r\n	<li><strong>সংশ্লিষ্ট &nbsp;উপজেলা / থানা নির্বাচন অফিসারের অধীনে ডাটা এন্ট্রি কন্ট্রোল সুপারভাইজারের তত্বাবধানে থেকে কার্যক্রম সম্পাদন করবেন l</strong></li>\r\n	<li><strong>জাতীয় পরিচয়পত্র ও ভোটার নিবন্ধন ও স্থানান্তর সংক্রান্ত সকল আবেদন গ্রহণকরা l</strong></li>\r\n	<li><strong>সকল প্রকার ডাটা এন্ট্রি করা l</strong></li>\r\n	<li><strong>সেবাগ্রহীতা নাগরিককে তার চাহিত সেবা / আবেদনের অসম্পূর্ণতা বিনয়ের সাথে ব্যাখ্যা করবেন এবং আবেদন সম্পূর্ণ &nbsp;করণে সহায়তা প্রদান করবেন l</strong></li>\r\n	<li><strong>সেবাগ্রহীতা কোনো ঊর্ধ্বতন কর্মকর্তার সাক্ষাত চাইলে সংশ্লিষ্ট &nbsp;কর্মকর্তার অনুমতিক্রমে তার ব্যবস্থা নিবেন l</strong></li>\r\n	<li><strong>হারানো কার্ডের আবেদন আপলোড করা ও কার্ড বিতরণ করা l</strong></li>\r\n	<li><strong>ভোটার তালিকা ও জাতীয় পরিচয়পত্র বিষয়ক যে কোন &nbsp;কাজ উর্ধ্বতনের নির্দেশনা অনুযায়ী সম্পাদন করবেন l</strong></li>\r\n	<li><strong>ঊর্ধ্বতন কর্মকর্তার নির্দেশে প্রকল্পের স্বার্থে যে কোন ধরণের দায়িত্ব পালন করতে বাধ্য থাকবেন l</strong></li>\r\n	<li><strong>সংশ্লিষ্ট শাখার আইসিটি ইকুইপমেন্ট ইনস্টলেশন, রক্ষণাবেক্ষন নিশ্চিত করবেন l</strong></li>\r\n	<li><strong>ভোটার তালিকা ও জাতীয় পরিচয়পত্র বিষয়ক যে কোনো কাজ নির্দেশনা অনুযায়ী সম্পাদন করবেন l</strong></li>\r\n	<li><strong>চিঠিপত্র টাইপকরণে কর্মকর্তাদের প্রয়োজনীয় সহায়তা প্রদান&nbsp;&nbsp;l</strong></li>\r\n</ul>', '2021-09-09 03:45:12', '2021-09-10 02:55:22'),
(50, '<ul>\r\n	<li><strong>সকল ড্রাইভারকে প্রকল্প পরিচালক কর্তৃক নিযুক্ত ভারপ্রাপ্ত কর্মকর্তার নিকট রিপোর্ট করতে হবে সকল ড্রাইভারকে প্রকল্প কর্তৃক নির্দেশিত দায়িত্বসমূহ যথাযথভাবে পালন করতে হবে l</strong></li>\r\n	<li><strong>সকল ড্রাইভারকে তাদের নামে বরাদ্দকৃত গাড়িসমূহের নিয়মিত পরিষ্কার পরিছন্নতার, রক্ষনাবেক্ষন এর জন্য দায়বদ্ধ থাকতে হবে l</strong></li>\r\n	<li><strong>সকল ড্রাইভারকে দায়িত্ব পালনকালীন সময় &quot;Service Provider&quot; কর্তৃক ইস্যুকৃত ইউনিফর্ম পরিধান করতে হবে l</strong></li>\r\n	<li><strong>ড্রাইভারগণকে অফিস সময় &nbsp;শুরু &nbsp;হওয়ার কমপক্ষে এক ঘন্টা পূর্বে আদেশকৃত স্থানে বা অফিসে যোগদান করতে হবেl</strong></li>\r\n	<li><strong>সংশ্লিষ্ট কর্মকর্তার দায়িত্বপালন কিংবা নির্ধারিত দায়িত্ব পালনের জন্য গ্যারেজ হতে গাড়ি গ্রহণের পূর্বে প্রয়োজনীয় সকল প্রকার চেকিং করে নিতে হবে l</strong></li>\r\n	<li><strong>অফিস সময় শেষ না হওয়া পর্যন্ত &nbsp;সকল ড্রাইভারকে সংশ্লিষ্ট কর্মকর্তাগণ এর জন্য অপেক্ষামান থাকতে হবে l</strong></li>\r\n	<li><strong>দায়িত্ব পালন শেষে অফিস ত্যাগ করার পূর্বে সংশ্লিষ্ট গাড়ি নির্ধারিত গ্যারেজে পার্কিং / জমা দেয়ার সময় ফাইনালি একবার প্রয়োজনীয় চেক আপ &nbsp;করে গাড়ি গ্যারেজে রাখতে হবে l</strong></li>\r\n	<li><strong>সকল ড্রাইভারকে গাড়ির প্রয়োজনীয় ডকুমেন্টস যেমনঃ গাড়ীর লগ বুক, হালনাগাদ &nbsp;ট্যাক্স টোকেন, ফিটনেস সনদ, গাড়ীর ব্লু বুক ও ড্রাইভিং লাইসেন্স সঙ্গে সংরক্ষণ করতে হবে l</strong></li>\r\n	<li><strong>সকল ড্রাইভারকে সব সময় গাড়ির সুরক্ষা নিশ্চিত করতে হবে&nbsp; l</strong></li>\r\n</ul>', '2021-09-09 03:49:19', '2021-09-10 02:58:24'),
