INSERT INTO `terms_policies` (`terms_policy_id`, `terms_policy_heading`, `terms_policy_description`, `created_at`, `updated_at`) VALUES
(8, 'Message from the CEO', 'American authorities seized a range of Iran\'s state-linked news website domains they accused of spreading disinformation, the US Justice Department said Tuesday, a move that appeared to be a far-reaching crackdown on Iranian media amid heightened tensions between the two countries. The Justice Department said 33 of the seized websites were used by the Iranian Islamic Radio and Television Union, which was singled out by the US government last October for what officials described as efforts to spread disinformation and sow discord among American voters ahead of the 2020 presidential election. The US says three other seized websites were operated by the Iraqi Shiite paramilitary group, Kata\'ib Hizballah, which more than a decade ago was designated a foreign terrorist organization. The group is separate from the Lebanese militant Hezbollah group whose news websites remained operational.', '2021-07-10 18:48:41', '2021-07-28 07:25:15'),
